body:
In the "Introducing Tableau" checkpoint, my editor had this question:

The next checkpoint,  starts with "At the end of the last checkpoint, you installed Tableau Public." But I'm not seeing any installation instructions in this checkpoint. Has this been moved?

@summerofgeorge Just mentioning you here bc this feels slightly more urgent -- not sure if there should be instructions? Maybe they're in Learnosity? Here's the course link: https://courses.thinkful.com/dabc-tableau-1-v1/checkpoint/1

We are going to drop SQLAlchemy and just use `pandas` for this part so will want to re-tool this checkpoint. 

@AVJdataminer   Can you [set up a call](https://calendly.com/gjmount/30min?back=1&month=2020-07) to walk through this one? Thank you.
Will be as high-priority as autograding.
